import React from 'react';

function RecipeList({ recipes, onSelectRecipe }) {
    return (
        <div>
            {recipes.map((recipe, index) => (
                <div key={index} onClick={() => onSelectRecipe(recipe)}>
                    <h3>{recipe.title}</h3>
                    {/* Add more details as needed */}
                </div>
            ))}
        </div>
    );
}

export default RecipeList;
